import React, { Component } from "react";

class Sinopse extends Component {
  render() {
    return (
      <div className="Sinopse">
        <div class="sinopse-cont">
          <h1 className="title">Sinopse</h1>
          <p>
            Num universo contstruído por seis corpos, é representado o ciclo de
            vida das borboletas monarca, espécie em vias de extinção. A sua
            metamorfose insere-se num contexto contemporâneo e eletrónico de
            desconstrução da imagem da Natureza como a conhecemos. <br />
            Guiados por formas e padrões geométricos, os corpos movem-se com
            estímulos sonoros que acompanham os ciclos de vida da espécie.
          </p>
        </div>
      </div>
    );
  }
}

export default Sinopse;
